import './App.css';
import React, { useState } from 'react';

function App() {
    const [view_tick, set_tick] = useState(0);
    return (
        <div className="App">
            <header id="header">
                <a href="#">Home</a>
                <a href="#">Policy</a>
                <a href="#">Content</a>
            </header>
            <div id="main">
                <div id="data-stream">
                    <center>
                        <code>
                            <b>
                                {tick(set_tick)}
                                {view_tick}
                            </b>
                        </code>
                    </center>
                </div>
            </div>
            <footer id="footer">
                <div id="footer-id">
                    <a id="footer-id-a">todo-lib.in</a>
                </div>
            </footer>
        </div>
    );
}

function tick(set_tick) {
    setTimeout(() => {
        set_tick(Date());
    }, 1000)
}

export default App;
